please as per ITE-1592

The custom Java Script in the Engine is not taking the exchange rate into account. So the script does not compare the EUR amount, but the original amount with 60 ... (see validation.Entertainment.4)
{code:java}
Â  Â  log.debug("FDF 'Event number PVGM' should be mandatory for internal participants with an amount above 60 EUR");
Â  Â Â 
Â  Â  if (element.isInternal() || (element.isMixed() && isEntertainmentInternal(element))) {
Â  Â  Â  Â  if (isEntertainmentAmountLimitExceeded(element) && !element.getParentReceipt().getStringLinkValue("expense.entertainment.eventNumberPvgm")) {
Â  Â  Â  Â  Â  Â  actionMarker.setActionSuccessfull(false);
Â  Â  Â  Â  Â  Â  actor.registerError("error.expense.entertainment.amountLimit.exceeded");
Â  Â  Â  Â  Â  Â  actor.registerErrorOn(element.getParentReceipt(), "error.expense.entertainment.amountLimit.exceeded");
Â  Â  Â  Â  }
Â  Â  }
Â  Â Â 
Â  Â  // According to the agreement with the customer, an entertainment should be "external" if the percentage of the third-party participants are > 10%.
Â  Â  function isEntertainmentInternal(entertainment) {
Â  Â  Â  Â  return (entertainment.getExternal().size() * 100 / (entertainment.getInternal().size() + entertainment.getExternal().size())) <= 10;
Â  Â  }
Â  Â Â 
Â  Â  // According to the agreement with the customer, the account number changes for internal entertainments if the amount exceeds 60 EUR.
Â  Â  function isEntertainmentAmountLimitExceeded(entertainment) {
Â  Â  Â  Â  return (entertainment.getParentReceipt().getPrice().getAmount() / (entertainment.getInternal().size() + entertainment.getExternal().size())) > 60.0;
Â  Â  }
Â  Â  ]]> {code}
It is translated - if receipt amount / internal + external participants >60 then ...

!_SA_Code in question.png|thumbnail!

So in our case if (1348 / (3 + 0 )) >60 ...Â  and as 1348/3 is 449.33 it actually IS larger than 60Â 

+solution:+

Ask Codebusters to fix the script - it must take into account the exchange rate, that is stored in the price object ( (entertainment.getParentReceipt().getPrice().getAmount()Â *{color:#de350b}* rate{color}*Â )/ (entertainment.getInternal().size() + entertainment.getExternal().size())) > 60.0 )

